INSERT INTO `experiencias` (`id`, `titulo`, `texto`, `borrador`, `usuario_id`, `created_at`, `updated_at`) VALUES
(56, 'El Oasis Escolar', 'En el instituto , los estudiantes transformaron un área árida del patio en un oasis verde. Con la ayuda de profesores y voluntarios, instalaron un sistema de riego por goteo alimentado por agua reciclada. Ahora, el espacio no solo es un refugio para la fauna local, sino también un laboratorio vivo donde los alumnos aprenden sobre la importancia del agua en la biodiversidad.', 0, 6, '2024-02-27 13:08:54', '2024-02-27 13:09:37'),
(57, 'Huertos Verticales', 'Inspirados por la escasez de espacio, los estudiantes del Instituto  diseñaron e instalaron huertos verticales en las paredes exteriores del edificio. Utilizando técnicas de hidroponía, cultivan una variedad de plantas sin necesidad de grandes extensiones de tierra. Esta iniciativa no solo proporciona alimentos frescos para la cafetería escolar, sino que también promueve la conciencia ambiental entre los jóvenes.', 0, 17, '2024-02-27 13:16:14', '2024-02-27 13:16:36'),
(58, 'Jardín Sensorial', 'Los estudiantes del instituto desarrollaron un jardín sensorial para personas con discapacidad visual. Diseñaron el espacio con una variedad de plantas aromáticas, texturas y sonidos para estimular todos los sentidos. Además de ser un lugar de relajación para la comunidad escolar, este jardín promueve la inclusión y la sensibilización sobre la importancia del agua en la naturaleza.', 0, 16, '2024-02-27 13:19:21', '2024-02-27 13:19:43'),
(59, 'Agua Limpia', 'Los estudiantes se asociaron con organizaciones locales para mejorar la calidad del agua en su comunidad. A través de campañas de concientización y limpieza de ríos y arroyos, trabajaron para proteger los recursos hídricos locales. Esta experiencia no solo tuvo un impacto positivo en el medio ambiente, sino también en el bienestar de la comunidad en general.', 0, 15, '2024-02-27 13:22:27', '2024-02-27 13:22:49'),
(61, 'El Bosque Subterráneo', 'En el Instituto Bosque Verde, los estudiantes exploraron el mundo subterráneo del agua. A través de la construcción de un sistema de riego subterráneo, simularon la filtración natural del agua en el suelo y su papel en el ciclo hidrológico. Esta experiencia no solo enseñó conceptos científicos, sino también la importancia de preservar los ecosistemas acuáticos subterráneos.', 0, 14, '2024-02-27 13:29:23', '2024-02-27 13:29:40'),
(62, 'El Huerto Sostenible', 'Los estudiantes se embarcaron en un proyecto para crear un huerto escolar sostenible. Comenzaron investigando sobre técnicas de agricultura ecológica y diseño de paisajes comestibles. Después de obtener permisos y fondos, transformaron un área abandonada del campus en un próspero huerto.', 0, 7, '2024-02-27 13:31:33', '2024-02-27 13:31:54');

